import {useHistory} from 'react-router-dom';

const NewSupply = () => {
    const history = useHistory();

    const handleSubmit = () => {
        history.push("/add-supply")
    }

    const finishedAdding = () => {
        history.push("/")
    }

    return (
        <div>
        <form className="form" onSubmit={()=>handleSubmit()} style={{margin:"25px", padding:"25px", border:"solid black 2px"}}>
            <h2>Enter Ingredients Purchased</h2>
            <div className="form-control" style={{margin:"15px"}}>
                Ingredient Name: <input />
            </div>
            <div className="form-control" style={{margin:"15px"}}>
                Price ($): <input type="Number" />
            </div>
            <div className="form-control" style={{margin:"15px"}}>
                Quantity: <input type="Number" />
            </div>
            <div style={{margin:"15px"}}>
                Multiple Servings in Container: <input type="Number" />
            </div>
            <button className="btn btn-warning">Add Supply</button>
        </form>
        <button style={{margin:"35px"}} className="btn btn-success" onClick={()=>finishedAdding()}>Finished Adding Supplies</button>
        </div>
    )
}

export default NewSupply
